import React from 'react';


class VRModel extends React.Component {
   
   render() {
      const divStyle ={
         width: '25%',
         margin: 'auto'
      };
      return (
         <div>

         <a href="#">Go Back</a>
         <div style={divStyle}>
<model-viewer camera-controls autoplay shadow-intensity="1" src="Images/scene.gltf" >


</model-viewer>
</div>
         </div>
      );
   }
}
export default VRModel;
